Verenigde Staten / Verenigd Koninkrijk
Muziek / Romantiek
143 minuten

geregisseerd door Joel Schumacher
met Gerard Butler, Emmy Rossum en Patrick Wilson

&quot;Phantom of the Opera&quot; vertelt het verhaal van een gemaskerde figuur die in de donkere kelders van het Parijse operagebouw woont, en angst inboezemt op iedereen die er komt. Hij wordt waanzinnig verliefd op een onschuldige, jonge zangeres, Christine, en wijdt al zijn tijd aan haar om een grote ster van haar te maken.



